import React from 'react';
import './App.css';
import './Todolist'
import {Microtask} from "./Microtask";

function App() {

    const topCars = [
        {manufacturer:'BMW', model:'m5cs'},
        {manufacturer:'Mercedes', model:'e63s'},
        {manufacturer:'Audi', model:'rs6'}
    ]

    return (
        <div className="App">
            <Microtask cars={topCars} />
        </div>
    );
}


export default App
